import React from 'react';
import temple from '../../img/museum.png'

const middleStyle = {
    fontSize: "48px",
    paddingLeft: "120px",
    backgroundColor: '#250c00',
    backgroundImage: `url(${temple})`,
    backgroundRepeat: 'no-repeat',
    minHeight: '410px',
}

export default function Middle() {
    return (
        <div style={middleStyle}>dffd</div>
    );
}
